description:
Rocky 5 1990

Verenigde Staten
Actie / Drama
104 minuten

geregisseerd door John G. Avildsen
met Sylvester Stallone, Burt Young en Sage Stallone

Nadat gebleken is dat de Russische bokser Ivan Drago Rocky permanente 
hersenbeschadiging heeft toegebracht, is Rocky gedwongen om te stoppen. 
Wanneer hij thuiskomt komt hij er achter dat al zijn geld gestolen is. 
Rocky besluit een jonge bokser te gaan trainen. Hij kan echter niet op 
tegen de hoge salarissen die de jongen aangeboden worden door andere 
managers
